(window.webpackJsonp=window.webpackJsonp||[]).push([[65],{j2zq:function(e){e.exports=[{id:1,type:"  mysql_database",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the database. This must be unique within\na given MySQL server and may or may not be case-sensitive depending on\nthe operating system on which the MySQL server is running.</p>\n</li>',elementType:"li",listDepth:1},{name:"default_character_set",description:'<li><p><a name="default_character_set"></a><a href="#default_character_set"><code>default_character_set</code></a> - <strong>(Optional)</strong> The default character set to use when\na table is created without specifying an explicit character set. Defaults\nto "utf8".</p>\n</li>',elementType:"li",listDepth:1},{name:"default_collation",description:'<li><p><a name="default_collation"></a><a href="#default_collation"><code>default_collation</code></a> - <strong>(Optional)</strong> The default collation to use when a table\nis created without specifying an explicit collation. Defaults to\n<code>utf8_general_ci</code>. Each character set has its own set of collations, so\nchanging the character set requires also changing the collation.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>Note that the defaults for character set and collation above do not respect\nany defaults set on the MySQL server, so that the configuration can be set\nappropriately even though Terraform cannot see the server-level defaults. If\nyou wish to use the server's defaults you must consult the server's\nconfiguration and then set the <code>default_character_set</code> and\n<code>default_collation</code> to match.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/mysql/r/database.html",docType:""},{id:2,type:"  mysql_grant",properties:[{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>Note:</strong> MySQL removed the <code>REQUIRE</code> option from <code>GRANT</code> in version 8. <code>tls_option</code> is ignored in MySQL 8 and above.</p>\n</div>',elementType:"div"},{name:"",description:'<div class="alert alert-warning" role="alert">\n<p><strong>Note:</strong> Attributes <code>role</code> and <code>roles</code> are only supported in MySQL 8 and above.</p>\n</div>',elementType:"div"},{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"user",description:"<strong>(Optional)</strong> The name of the user. Conflicts with <code>role</code>.\n",elementType:"li",listDepth:1},{name:"host",description:'<strong>(Optional)</strong> The source host of the user. Defaults to "localhost". Conflicts with <code>role</code>.\n',elementType:"li",listDepth:1},{name:"role",description:"<strong>(Optional)</strong> The role to grant <code>privileges</code> to. Conflicts with <code>user</code> and <code>host</code>.\n",elementType:"li",listDepth:1},{name:"database",description:"<strong>(Required)</strong> The database to grant privileges on.\n",elementType:"li",listDepth:1},{name:"table",description:"<strong>(Optional)</strong> Which table to grant <code>privileges</code> on. Defaults to <code>*</code>, which is all tables.\n",elementType:"li",listDepth:1},{name:"privileges",description:'<strong>(Optional)</strong> A list of privileges to grant to the user. Refer to a list of privileges (such as <a href="https://dev.mysql.com/doc/refman/5.5/en/grant.html">here</a>) for applicable privileges. Conflicts with <code>roles</code>.\n',elementType:"li",listDepth:1},{name:"roles",description:"<strong>(Optional)</strong> A list of rols to grant to the user. Conflicts with <code>privileges</code>.\n",elementType:"li",listDepth:1},{name:"tls_option",description:"<strong>(Optional)</strong> An TLS-Option for the <code>GRANT</code> statement. The value is suffixed to <code>REQUIRE</code>. A value of 'SSL' will generate a <code>GRANT ... REQUIRE SSL</code> statement. See the <a href=\"https://dev.mysql.com/doc/refman/5.7/en/grant.html\">MYSQL <code>GRANT</code> documentation</a> for more. Ignored if MySQL version is under 5.7.0.\n",elementType:"li",listDepth:1},{name:"grant",description:"<strong>(Optional)</strong> Whether to also give the user privileges to grant the same privileges to other users.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/mysql/r/grant.html",docType:""},{id:3,type:"  mysql_role",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the role.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/mysql/r/role.html",docType:""},{id:4,type:"  mysql_user",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"user",description:"<strong>(Required)</strong> The name of the user.\n",elementType:"li",listDepth:1},{name:"host",description:'<strong>(Optional)</strong> The source host of the user. Defaults to "localhost".\n',elementType:"li",listDepth:1},{name:"plaintext_password",description:"<strong>(Optional)</strong> The password for the user. This must be provided in plain text, so the data source for it must be secured. An <em>unsalted</em> hash of the provided password is stored in state. Conflicts with <code>auth_plugin</code>.\n",elementType:"li",listDepth:1},{name:"password",description:"<strong>(Optional)</strong> Deprecated alias of <code>plaintext_password</code>, whose value is <em>stored as plaintext in state</em>. Prefer to use <code>plaintext_password</code> instead, which stores the password as an unsalted hash. Conflicts with <code>auth_plugin</code>.\n",elementType:"li",listDepth:1},{name:"auth_plugin",description:'<strong>(Optional)</strong> Use an <a href="https://dev.mysql.com/doc/refman/5.7/en/authentication-plugins.html">authentication plugin</a> to authenticate the user instead of using password authentication.  Description of the fields allowed in the block below. Conflicts with <code>password</code> and <code>plaintext_password</code>.<br/>\n',elementType:"li",listDepth:1},{name:"tls_option",description:"<strong>(Optional)</strong> An TLS-Option for the <code>CREATE USER</code> or <code>ALTER USER</code> statement. The value is suffixed to <code>REQUIRE</code>. A value of 'SSL' will generate a <code>CREATE USER ... REQUIRE SSL</code> statement. See the <a href=\"https://dev.mysql.com/doc/refman/5.7/en/create-user.html\">MYSQL <code>CREATE USER</code> documentation</a> for more. Ignored if MySQL version is under 5.7.0.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>auth_plugin</code> value supports:</p>",elementType:"p"},{name:"AWSAuthenticationPlugin",description:'<li><p><a name="awsauthenticationplugin"></a><a href="#awsauthenticationplugin"><code>AWSAuthenticationPlugin</code></a> - Allows the use of IAM authentication with <a href="https://aws.amazon.com/rds/aurora/">Amazon\nAurora</a>. For more details on how to use IAM auth with\nAurora, see <a href="https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/UsingWithRDS.IAMDBAuth.html#UsingWithRDS.IAMDBAuth.Creating">here</a>.</p>\n</li>',elementType:"li",listDepth:1},{name:"mysql_no_login",description:'<li><p><a name="mysql_no_login"></a><a href="#mysql_no_login"><code>mysql_no_login</code></a> - Uses the MySQL No-Login Authentication Plugin. The\nNo-Login Authentication Plugin must be active in MySQL. For more information,\nsee <a href="https://dev.mysql.com/doc/refman/5.7/en/no-login-pluggable-authentication.html">here</a>.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/mysql/r/user.html",docType:""},{id:5,type:"  mysql_user_password",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"user",description:"<strong>(Required)</strong> The IAM user to associate with this access key.\n",elementType:"li",listDepth:1},{name:"pgp_key",description:"<strong>(Required)</strong> Either a base-64 encoded PGP public key, or a keybase username in the form <code>keybase:some_person_that_exists</code>.\n",elementType:"li",listDepth:1},{name:"host",description:"<strong>(Optional)</strong> The source host of the user. Defaults to <code>localhost</code>.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/mysql/r/user_password.html",docType:""}]}}]);